import React from 'react';
import { ThemeProvider } from 'styled-components';
import GlobalStyles from 'components/styled/Global';
import { OuterWrapper, InnerWrapper } from 'components/Wrappers';
import Header from './components/Header';

const theme = {
  colors: {
    mainColor: 'rgba(128, 136, 255, 1)',
    subColor: 'rgba(255, 132, 24, 1)',
    thirdColor: 'rgb(163, 163, 163)',
    sectionBg: '#f4f4f4'
  },
  fonts: {
    mainFont: ['Montserrat', 'sans-serif'],
    subFont: ['Roboto', 'sans-serif']
  }
};

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <GlobalStyles />
      <OuterWrapper>
        <InnerWrapper>
          <Header />
        </InnerWrapper>
      </OuterWrapper>
    </ThemeProvider>
  );
};

export default App;
